import React from 'react';

const AdminDashboard = ({ stats }) => {
  // 1. Core Calculations [cite: 655, 656]
  const totalMeetings = stats.filter(s => s.type.includes('Meeting')).length;
  const totalDistance = stats.reduce((acc, s) => acc + (s.distanceToday || 0), 0);
  
  // Sales Split Logic [cite: 658]
  const b2bSales = stats.filter(s => s.type === 'Sale' && s.payload?.mode?.toUpperCase() === 'B2B').length;
  const b2cSales = stats.filter(s => s.type === 'Sale' && s.payload?.mode?.toUpperCase() === 'B2C').length;
  const totalSalesCount = b2bSales + b2cSales || 1; // Division by zero error se bachne ke liye

  return (
    <div style={dashStyles.wrapper}>
      <h2 style={{color: '#2c3e50'}}>üõ∞Ô∏è Occamy Central Control</h2>
      
      {/* 2. Metrics Summary Cards [cite: 653, 655] */}
      <div style={dashStyles.grid}>
        <div style={dashStyles.card}><h4>Total Distance</h4><p>{totalDistance} km</p></div>
        <div style={dashStyles.card}><h4>Meetings</h4><p>{totalMeetings}</p></div>
        <div style={dashStyles.card}><h4>B2B Sales</h4><p>{b2bSales}</p></div>
        <div style={dashStyles.card}><h4>B2C Sales</h4><p>{b2cSales}</p></div>
      </div>

      {/* 3. Visual Charts (New Addition for Hackathon Points)  */}
      <div style={dashStyles.chartSection}>
        <h3>Sales Distribution (B2B vs B2C)</h3>
        <div style={dashStyles.barContainer}>
          {/* B2B Bar */}
          <div style={{
            ...dashStyles.bar, 
            width: `${(b2bSales / totalSalesCount) * 100}%`, 
            background: '#3498db'
          }}>
            {b2bSales > 0 ? `B2B (${b2bSales})` : ''}
          </div>
          {/* B2C Bar */}
          <div style={{
            ...dashStyles.bar, 
            width: `${(b2cSales / totalSalesCount) * 100}%`, 
            background: '#e67e22'
          }}>
            {b2cSales > 0 ? `B2C (${b2cSales})` : ''}
          </div>
        </div>
        <p style={{fontSize: '12px', marginTop: '10px', color: '#7f8c8d'}}>
          * Visual representation of Sales split as required by problem statement.
        </p>
      </div>

      {/* 4. Verifiable Activity Table [cite: 612, 659] */}
      <div style={dashStyles.tableBox}>
        <h3>Ground Activity Log (Verifiable)</h3>
        <table style={dashStyles.table}>
          <thead>
            <tr style={{background: '#ecf0f1'}}>
              <th style={dashStyles.th}>Officer</th>
              <th style={dashStyles.th}>Type</th>
              <th style={dashStyles.th}>Village</th>
              <th style={dashStyles.th}>GPS Location</th>
              <th style={dashStyles.th}>Proof</th>
            </tr>
          </thead>
          <tbody>
            {stats.map(s => (
              <tr key={s.id} style={{borderBottom: '1px solid #eee'}}>
                <td style={dashStyles.td}>{s.officer}</td>
                <td style={dashStyles.td}><strong>{s.type}</strong></td>
                <td style={dashStyles.td}>{s.village || 'N/A'}</td>
                <td style={dashStyles.td}>
                  {s.location ? `${s.location.lat.toFixed(4)}, ${s.location.lng.toFixed(4)}` : 'No GPS'}
                </td>
                <td style={dashStyles.td}>
                  {s.photo && (
                    <a href={`http://localhost:5000${s.photo}`} target="_blank" rel="noreferrer" style={{color: '#3498db', fontWeight: 'bold'}}>
                      üñºÔ∏è View Proof
                    </a>
                  )}
                </td>
              </tr>
            ))}
          </tbody>
        </table>
      </div>
    </div>
  );
};

const dashStyles = {
  wrapper: { padding: '20px', backgroundColor: '#f4f7f6', minHeight: '100vh', fontFamily: 'sans-serif' },
  grid: { display: 'flex', gap: '15px', marginBottom: '25px' },
  card: { flex: 1, padding: '20px', background: '#fff', borderRadius: '12px', boxShadow: '0 4px 6px rgba(0,0,0,0.1)', textAlign: 'center' },
  chartSection: { background: '#fff', padding: '20px', borderRadius: '12px', marginBottom: '25px', boxShadow: '0 4px 6px rgba(0,0,0,0.1)' },
  barContainer: { height: '35px', display: 'flex', borderRadius: '8px', overflow: 'hidden', background: '#eee', marginTop: '15px' },
  bar: { display: 'flex', alignItems: 'center', justifyContent: 'center', color: '#fff', fontWeight: 'bold', transition: 'width 0.5s ease', fontSize: '14px' },
  tableBox: { background: '#fff', padding: '20px', borderRadius: '12px', overflowX: 'auto', boxShadow: '0 4px 6px rgba(0,0,0,0.1)' },
  table: { width: '100%', borderCollapse: 'collapse' },
  th: { padding: '12px', textAlign: 'left', borderBottom: '2px solid #ddd' },
  td: { padding: '12px' }
};

export default AdminDashboard;
